import React from "react";
import { NavLink } from "react-router-dom";

import Button from "@material-ui/core/Button";
import {
  createMuiTheme,
  withStyles,
  makeStyles,
} from "@material-ui/core/styles";

import error404 from "../media/error/error404.svg";

const BootstrapButton = withStyles({
  root: {
    boxShadow: "none",
    textTransform: "none",
    fontSize: 16,
    padding: "6px 12px",
    border: "1px solid",
    lineHeight: 1.5,
    backgroundColor: "#a62149",
    borderColor: "#007bff",
    fontFamily: ['Roboto'].join(","),
    "&:hover": {
      backgroundColor: "#a62149",
      borderColor: "#a62149",
    },
    "&:active": {
      boxShadow: "none",
      backgroundColor: "#a62149",
      borderColor: "#005cbf",
    },
    "&:focus": {
      boxShadow: "0 0 0 0.2rem rgba(0,123,255,.5)",
    },
  },
})(Button);

const useStyles = makeStyles((theme) => ({
  margin: {
    margin: theme.spacing(1),
  },
}));

const Error404 = () => {
  const classes = useStyles();
  return (
    <div className="error404">
      <div className="divErrorLogo">
        <img src={error404} alt="React Logo" className="errorLogo" />
      </div>
      <h2>Oops, you broke the internet</h2>
      <p className="textError">
        Just kidding. But it seems Robo, your personal robot, can't find the
        page you're looking for. Please make sure you've entered the correct
        address, or return to Home.
      </p>
      <NavLink exact to="/" activeClassName="navActive">
        <Button variant="contained" color="primary" className={classes.margin}>
          Home <i class="fas fa-home" />  
        </Button>
      </NavLink>
    </div>
  );
};

export default Error404;
